import React, { Component } from "react";
import { Routes, Route, Link } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";

import AddTutorial from "./components/add-customer.component";
import Tutorial from "./components/customer.component";
import TutorialsList from "./components/tutorials-list.component";
import PlaceOrder from "./components/orders.component";

class App extends Component {
  render() {
    return (
      <div>
        <nav className="navbar navbar-expand navbar-dark bg-dark">
          <Link to={"/customerOrderManager"} className="navbar-brand">
            Customer Order manager
          </Link>
          <div className="navbar-nav mr-auto">
            <li className="nav-item">
              <Link to={"/customerOrderManager"} className="nav-link">
                View Customers
              </Link>
            </li>
            <li className="nav-item">
              <Link to={"/add"} className="nav-link">
                Add Customer
              </Link>
            </li>
          </div>
        </nav>

        <div className="container mt-3">
          <Routes>
            <Route path="/" element={<TutorialsList/>} />
            <Route path="/customerOrderManager" element={<TutorialsList/>} />
            <Route path="/add" element={<AddTutorial/>} />
            <Route path="/customerOrderManager/:id" element={<Tutorial/>} />
            <Route path="/place-order" element={<PlaceOrder/>} />
          </Routes>
        </div>
      </div>
    );
  }
}

export default App;
